import React from "react";
import "./news.scss";

const News = ({ name, imgUrl, message }) => {
  return (
    <div className="newsbox">
      <div class="info-container">
        <img src={process.env.PUBLIC_URL + imgUrl} alt={name} />

      <h4>{name}</h4>



      <h5>{message}</h5>
      </div>
    </div>
  );
};

export default News;
